import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { robots } from './Robots';
import * as serviceWorker from './serviceWorker';
import 'tachyons';

ReactDOM.render(
    <Cardlist robots = { robots } />, 
    document.getElementById('root')
);

serviceWorker.unregister();
